require('dotenv').config({ path: '.env.local' });
const { createClient } = require('@supabase/supabase-js');

const supabase = createClient(process.env.SUPABASE_URL, process.env.SUPABASE_KEY);
const bucket = process.env.SUPABASE_GALLERY_BUCKET || 'Gallery';

// Test with the exact filename from your screenshot
const filename = '5035f2cf008c38e4eeb86d0b9802d10c.jpg';

const { data: publicUrlData } = supabase.storage
  .from(bucket)
  .getPublicUrl(filename);

console.log('Testing public URL for:', filename);
console.log('Public URL:', publicUrlData.publicUrl);
console.log('');
console.log('Try opening this URL in your browser to see if the image loads.');
